            {
                tea = await Http.GetFromJsonAsync<Team>($"api/team/{args.Username}");
                page_access = tea.access;
                isLoading = false;

            }
        }
        catch (Exception e)
        {
            isLoading = false;
            Console.WriteLine(e.Message);
        }

    }


